import React, { useState } from 'react'
import { Button, Container } from 'react-bootstrap'
import CreatUser from '../components/modals/CreateUser'

const Admin = () => {

    const [nicknameVisible, setNicknameVisible] = useState(false)
    const [userVisible, setUserVisible] = useState(false)


    return (
        <Container className="d-flex flex-column">
            <h1>Добавить Героя</h1>
            <Button 
onClick={() => setUserVisible(true)}
            variant={"outline-dark"} 
            className="mt-3">
                Nickname HERO</Button>

            <CreatUser show={userVisible} onHide={() => setUserVisible(false)}/>
            
        </Container>
    )
}

export default Admin
